import * as React from "react";
import { styled } from "@mui/material/styles";

import Table from "@mui/material/Table";
import Box from "@mui/material/Box";
import Grid from "@mui/material/Grid";

import Divider from "@mui/material/Divider";

import TableBody from "@mui/material/TableBody";
import TableCell from "@mui/material/TableCell";
import TableContainer from "@mui/material/TableContainer";
import TableHead from "@mui/material/TableHead";
import TableRow from "@mui/material/TableRow";
import Paper from "@mui/material/Paper";
import Typography from "@mui/material/Typography";

import Button from "@mui/material/Button";

import NavigateNextRoundedIcon from "@mui/icons-material/NavigateNextRounded";

const Item = styled(Paper)(({ theme }) => ({
  backgroundColor: theme.palette.mode === "dark" ? "#1A2027" : "#fff",
  ...theme.typography.body2,
  padding: theme.spacing(1),
  textAlign: "center",
  color: theme.palette.text.secondary,
}));

function createData(handWash, exterior, interior, deluxe) {
  return { handWash, exterior, interior, deluxe };
}

const rows = [createData("$15", "$30", "$35", "$130")];

export default function BasicTable() {
  return (
    <Box sx={{ flexGrow: 1 }}>
      <Grid
        container
        spacing={2}
        direction="row"
        justifyContent="center"
        alignItems="center"
      >
        {/*//=========== GRID BOX START =================================> */}
        <Grid item xs={12} md={3.5}>
          <Item sx={{ bgcolor: "primary.main", color: "white" }}>
            <Divider>
              <Typography variant="h6">Detailing Prices</Typography>
              <Typography
                variant="h6"
                sx={{
                  fontWeight: 700,
                }}
              >
                Car
              </Typography>
            </Divider>

            {/* === === === === === === TABLE CONTAINER === === === === === === ===  */}
            <TableContainer component={Paper}>
              <Table
                sx={
                  {
                    /*INSERT CSS  */
                  }
                }
                aria-label="simple table"
              >
                <TableHead>
                  <TableRow>
                    <TableCell align="center">Hand Wash</TableCell>
                    <TableCell align="center">Interior Detail</TableCell>
                    <TableCell align="center">Exterior Detail</TableCell>
                    <TableCell align="center">Deluxe Detail**</TableCell>
                  </TableRow>
                </TableHead>
                <TableBody>
                  {rows.map((row) => (
                    <TableRow
                      bgColor="primary.main"
                      key={row.name}
                      sx={{ "&:last-child td, &:last-child th": { border: 0 } }}
                    >
                      <TableCell align="center">{row.handWash}</TableCell>
                      <TableCell align="center">{row.exterior}</TableCell>
                      <TableCell align="center">{row.interior}</TableCell>
                      <TableCell align="center">{row.deluxe}</TableCell>
                    </TableRow>
                  ))}
                </TableBody>
              </Table>
            </TableContainer>
            <br />
            <Button
              href="https://jeremyduncan.github.io/Battleship/"
              target="_blank"
              rel="noopener"
              variant="contained"
              endIcon={<NavigateNextRoundedIcon />}
            >
              Visit
            </Button>
          </Item>
        </Grid>



        {/*//=============== GRID END GOES TO BOTTOM  =====================> */}
      </Grid>

      {/* === === === === === === TABLE CONTAINER === === === === === === ===  */}
      <TableContainer component={Paper}>
        <Divider>
          <Typography
            variant="h6"
            sx={{
              fontWeight: 700,
            }}
          >
            Car
          </Typography>
        </Divider>
        <Table
          sx={
            {
              /*INSERT CSS  */
            }
          }
          aria-label="simple table"
        >
          <TableHead>
            <TableRow>
              <TableCell align="center">Hand Wash</TableCell>
              <TableCell align="center">Interior</TableCell>
              <TableCell align="center">Exterior</TableCell>
              <TableCell align="center">Deluxe**</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {rows.map((row) => (
              <TableRow
                bgColor="main.light"
                key={row.name}
                sx={{ "&:last-child td, &:last-child th": { border: 0 } }}
              >
                <TableCell align="center">{row.handWash}</TableCell>
                <TableCell align="center">{row.exterior}</TableCell>
                <TableCell align="center">{row.interior}</TableCell>
                <TableCell align="center">{row.deluxe}</TableCell>
              </TableRow>
            ))}
          </TableBody>
        </Table>
      </TableContainer>

      {/* === === === === === === TABLE CONTAINER === === === === === === ===  */}
      <TableContainer component={Paper}>
        <Divider>
          <Typography
            variant="h6"
            sx={{
              fontWeight: 700,
            }}
          >
            Regular Cab Truck
          </Typography>
        </Divider>
        <Table
          sx={
            {
              /*INSERT CSS  */
            }
          }
          aria-label="simple table"
        >
          <TableHead>
            <TableRow>
              <TableCell align="center">Hand Wash</TableCell>
              <TableCell align="center">Interior</TableCell>
              <TableCell align="center">Exterior</TableCell>
              <TableCell align="center">Deluxe**</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {rows.map((row) => (
              <TableRow
                bgColor="main.light"
                key={row.name}
                sx={{ "&:last-child td, &:last-child th": { border: 0 } }}
              >
                <TableCell align="center">{row.handWash}</TableCell>
                <TableCell align="center">{row.exterior}</TableCell>
                <TableCell align="center">{row.interior}</TableCell>
                <TableCell align="center">{row.deluxe}</TableCell>
              </TableRow>
            ))}
          </TableBody>
        </Table>
      </TableContainer>
      {/* === === === === === === TABLE CONTAINER === === === === === === ===  */}
      <TableContainer component={Paper}>
        <Divider>
          <Typography
            variant="h6"
            sx={{
              fontWeight: 700,
            }}
          >
            Extended Cab Truck
          </Typography>
        </Divider>
        <Table
          sx={
            {
              /*INSERT CSS  */
            }
          }
          aria-label="simple table"
        >
          <TableHead>
            <TableRow>
              <TableCell align="center">Hand Wash</TableCell>
              <TableCell align="center">Interior</TableCell>
              <TableCell align="center">Exterior</TableCell>
              <TableCell align="center">Deluxe**</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {rows.map((row) => (
              <TableRow
                bgColor="main.light"
                key={row.name}
                sx={{ "&:last-child td, &:last-child th": { border: 0 } }}
              >
                <TableCell align="center">{row.handWash}</TableCell>
                <TableCell align="center">{row.exterior}</TableCell>
                <TableCell align="center">{row.interior}</TableCell>
                <TableCell align="center">{row.deluxe}</TableCell>
              </TableRow>
            ))}
          </TableBody>
        </Table>
      </TableContainer>
      {/* === === === === === === TABLE CONTAINER === === === === === === ===  */}
      <TableContainer component={Paper}>
        <Divider>
          <Typography
            variant="h6"
            sx={{
              fontWeight: 700,
            }}
          >
            Van
          </Typography>
        </Divider>
        <Table
          sx={
            {
              /*INSERT CSS  */
            }
          }
          aria-label="simple table"
        >
          <TableHead>
            <TableRow>
              <TableCell align="center">Hand Wash</TableCell>
              <TableCell align="center">Interior</TableCell>
              <TableCell align="center">Exterior</TableCell>
              <TableCell align="center">Deluxe**</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {rows.map((row) => (
              <TableRow
                bgColor="main.light"
                key={row.name}
                sx={{ "&:last-child td, &:last-child th": { border: 0 } }}
              >
                <TableCell align="center">{row.handWash}</TableCell>
                <TableCell align="center">{row.exterior}</TableCell>
                <TableCell align="center">{row.interior}</TableCell>
                <TableCell align="center">{row.deluxe}</TableCell>
              </TableRow>
            ))}
          </TableBody>
        </Table>
      </TableContainer>
      {/* === === === === === === TABLE CONTAINER === === === === === === ===  */}
      <TableContainer component={Paper}>
        <Divider>
          <Typography
            variant="h6"
            sx={{
              fontWeight: 700,
            }}
          >
            Small SUV
          </Typography>
        </Divider>
        <Table
          sx={
            {
              /*INSERT CSS  */
            }
          }
          aria-label="simple table"
        >
          <TableHead>
            <TableRow>
              <TableCell align="center">Hand Wash</TableCell>
              <TableCell align="center">Interior</TableCell>
              <TableCell align="center">Exterior</TableCell>
              <TableCell align="center">Deluxe**</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {rows.map((row) => (
              <TableRow
                bgColor="main.light"
                key={row.name}
                sx={{ "&:last-child td, &:last-child th": { border: 0 } }}
              >
                <TableCell align="center">{row.handWash}</TableCell>
                <TableCell align="center">{row.exterior}</TableCell>
                <TableCell align="center">{row.interior}</TableCell>
                <TableCell align="center">{row.deluxe}</TableCell>
              </TableRow>
            ))}
          </TableBody>
        </Table>
      </TableContainer>
      {/* === === === === === === TABLE CONTAINER === === === === === === ===  */}
      <TableContainer component={Paper}>
        <Divider>
          <Typography
            variant="h6"
            sx={{
              fontWeight: 700,
            }}
          >
            Mid-Size SUV
          </Typography>
        </Divider>
        <Table
          sx={
            {
              /*INSERT CSS  */
            }
          }
          aria-label="simple table"
        >
          <TableHead>
            <TableRow>
              <TableCell align="center">Hand Wash</TableCell>
              <TableCell align="center">Interior</TableCell>
              <TableCell align="center">Exterior</TableCell>
              <TableCell align="center">Deluxe**</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {rows.map((row) => (
              <TableRow
                bgColor="main.light"
                key={row.name}
                sx={{ "&:last-child td, &:last-child th": { border: 0 } }}
              >
                <TableCell align="center">{row.handWash}</TableCell>
                <TableCell align="center">{row.exterior}</TableCell>
                <TableCell align="center">{row.interior}</TableCell>
                <TableCell align="center">{row.deluxe}</TableCell>
              </TableRow>
            ))}
          </TableBody>
        </Table>
      </TableContainer>
      {/* === === === === === === TABLE CONTAINER === === === === === === ===  */}
      <TableContainer component={Paper}>
        <Divider>
          <Typography
            variant="h6"
            sx={{
              fontWeight: 700,
            }}
          >
            Full-Size SUV
          </Typography>
        </Divider>
        <Table
          sx={
            {
              /*INSERT CSS  */
            }
          }
          aria-label="simple table"
        >
          <TableHead>
            <TableRow>
              <TableCell align="center">Hand Wash</TableCell>
              <TableCell align="center">Interior</TableCell>
              <TableCell align="center">Exterior</TableCell>
              <TableCell align="center">Deluxe**</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {rows.map((row) => (
              <TableRow
                bgColor="main.light"
                key={row.name}
                sx={{ "&:last-child td, &:last-child th": { border: 0 } }}
              >
                <TableCell align="center">{row.handWash}</TableCell>
                <TableCell align="center">{row.exterior}</TableCell>
                <TableCell align="center">{row.interior}</TableCell>
                <TableCell align="center">{row.deluxe}</TableCell>
              </TableRow>
            ))}
          </TableBody>
        </Table>
      </TableContainer>

      <Divider></Divider>
    </Box>
  );
}
